import { FC } from "react";
import Header from "../Header";
import Menu from "../Menu";
import axios from "axios";

type UserProps = {};

const User: FC<UserProps> = () => {

   axios.get(`https://model-fashion.herokuapp.com/user/getAllUser`)
    .then(res => {
      const user = res.data;
      // console.log(user, 'user');
    })
    .catch(error => console.log(error));

  // const [users, setUser] = useState<UserData[]>([]);
  // console.log(users, "users");

  return (
    <div>
      <Header />
      <div className="flex">
        <div className="w-[15%]">
          <Menu />
        </div>
        <div className="w-[85%]">{/*<UsersList users={users} />*/}</div>
      </div>
    </div>
  );
};

export default User;
